class Solution:
    """
    @param a: The A array
    @param b: The B array
    @param s: The S string
    @return: The answer
    """
    def stringReplace(self, a, b, s):
        # Write your code here
        dict = {a[i]: b[i] for i in range(len(a))}

        size = len(s)
        i = 0
        j = size

        output = s

        while j > i:
            if s[i:j] in dict.keys():
                output = output[0:i] + dict[s[i:j]] + output[j:size]
                i = j
                j = size

            else:
                j -= 1

        return output

